--PURPOSE    : PATCH FOR CREATING tables DIESEL_TIER, ENGINE_TIER_CTRY_MAPPING
--AUTHOR     : JYOTI CHAUHAN
--CREATED ON : 06-NOV-12

CREATE SEQUENCE DIESEL_TIER_SEQ MINVALUE 1 MAXVALUE 999999999999999999999999999 INCREMENT BY 20 START WITH 1000000000 CACHE 20 NOORDER NOCYCLE
/
CREATE SEQUENCE ENGINE_TIER_CTRY_MAPPING_SEQ MINVALUE 1 MAXVALUE 999999999999999999999999999 INCREMENT BY 20 START WITH 1000000000 CACHE 20 NOORDER NOCYCLE
/
CREATE TABLE DIESEL_TIER
  (
   ID                       NUMBER(19,0) NOT NULL ENABLE, 
   TIER                     VARCHAR2(1),  
   DESCRIPTION              VARCHAR2(1000),
   CONSTRAINT "DIESEL_TIER_PK" PRIMARY Key ("ID") ENABLE
  )
/
CREATE TABLE DIESEL_TIER_COUNTRY_MAPPING
  (
   ID                       NUMBER(19,0) NOT NULL ENABLE,
   DIESEL_TIER              NUMBER(19,0) NOT NULL ENABLE,
   COUNTRY                  NUMBER(19,0) NOT NULL ENABLE,
   CONSTRAINT "ENGINE_TIER_COUNTRY_MAPPING_PK" PRIMARY Key ("ID") ENABLE,
   CONSTRAINT "ENGINE_TIER_COUNTRY_MAPPING_FK" Foreign Key ("DIESEL_TIER") REFERENCES "DIESEL_TIER" ("ID") ENABLE,
   CONSTRAINT "ENGINE_TIER_CTRY_MAPPING_FK" Foreign Key ("COUNTRY") REFERENCES "COUNTRY" ("ID") ENABLE
   )
/
